import React, { PureComponent } from 'react';
import styled from '@emotion/styled';

const HeaderContainer = styled.header`
    position: relative;
    display: flex;
    align-items : center;
    justify-content : center;
`;

const Img = styled.img`
    width: 250px;
    height: 250px;
`;


const Header = () => {
    return (
        <HeaderContainer>

            <Img src="logo.png" alt="" srcset=""/>
        </HeaderContainer>
    );
}

export default Header;
